function fillCountries(countryId, cityId)
{
	// given the id of the <select> tag as function argument, it inserts <option> tags
	var countryElement = document.getElementById(countryId);
	countryElement.length=0;
	countryElement.options[0] = new Option('Select Country:','');
	countryElement.selectedIndex = 0;
	for (var i=0; i<country_arr.length; i++) {
		countryElement.options[countryElement.length] = new Option(country_arr[i],country_arr[i]);
	}

	// For cities
	if( cityId ){
		countryElement.onchange = function(){
			fillCities( countryId, cityId );
		};
	}
}

function fillCities(cityId)
{
	// given the id of the <select> tag as function argument, it inserts <option> tags
	var countryElement = document.getElementById(cityId);
	countryElement.length=0;
	countryElement.options[0] = new Option('Select City:','');
	countryElement.selectedIndex = 0;
	for (var i=0; i<cities_arr.length; i++) {
		countryElement.options[countryElement.length] = new Option(cities_arr[i],cities_arr[i]);
	}
}


